"use strict";

const input = `



`.split('\n');
const answer = [];
// Start point = 5
const keypad = { row: 1, column: 1};

for(let row of input) {
    let instructions = row.split('');
    for(let direction of instructions) {
        switch (direction) {
            case 'U':
                keypad.row--;
                break;
            case 'D':
                keypad.row++;
                break;
            case 'L':
                keypad.column--;
                break;
            case 'R':
                keypad.column++;
                break;
        }
        keypad.column = clamp(keypad.column);
        keypad.row = clamp(keypad.row);
    }
    answer.push(calculateNumber(keypad));
}

console.log(answer.join(''));

function clamp(value) {
    return Math.min(Math.max(value, 0), 2);
}

function calculateNumber(keypad) {
    return keypad.row * 3 + keypad.column + 1;
}